import { Grid, Typography, Box, TextField, Button, Alert } from '@mui/material';
import React, { useState } from 'react';

const Contact = () => {
    const [formData, setFormData] = useState({ name: '', email: '', message: '' });
    const [errors, setErrors] = useState({});
    const [submitted, setSubmitted] = useState(false);

    // Handle input change
    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    // Validate form
    const validate = () => {
        const tempErrors = {};
        if (!formData.name.trim()) tempErrors.name = 'Full Name is required';
        if (!formData.email.trim()) tempErrors.email = 'Email is required';
        else if (!/\S+@\S+\.\S+/.test(formData.email))
            tempErrors.email = 'Email is invalid';
        if (!formData.message.trim()) tempErrors.message = 'Message is required';
        setErrors(tempErrors);
        return Object.keys(tempErrors).length === 0;
    };

    // Handle submit
    const handleSubmit = (e) => {
        e.preventDefault();
        if (validate()) {
            console.log('Form submitted:', formData);
            setSubmitted(true);
            setFormData({ name: '', email: '', message: '' });
            setErrors({});
            // Optional: hide alert after 3s
            setTimeout(() => setSubmitted(false), 3000);
        }
    };

    return (
        <Grid
            container
            sx={{
                position: 'relative',
                backgroundColor: 'rgb(13, 1, 33)',
                px: { md: 10, xs: 3, sm: 6 },
                minHeight: { xs: '70vh', md: '90vh' },
                justifyContent: 'center',
                alignItems: 'center',
            }}
        >
            <Box sx={{ width: '100%' }}>
                {/* Heading */}
                <Typography
                    variant="h2"
                    sx={{
                        color: 'white',
                        fontWeight: 700,
                        fontFamily: 'inherit',
                        fontSize: { md: '3rem', xs: '2rem' },
                        textAlign: 'center',
                    }}
                >
                    Contact Me
                </Typography>

                <Typography
                    variant="body1"
                    sx={{
                        color: 'lightgray',
                        textAlign: 'center',
                        mt: 2,
                        fontSize: { md: '1.2rem', xs: '1rem' },
                        maxWidth: 700,
                        mx: "auto",
                    }}
                >
                    I’d love to hear from you! Fill out the form below and I’ll get back to you as soon as possible.
                </Typography>

                {/* Thank you alert */}
                {submitted && (
                    <Alert severity="success" sx={{ mt: 3, maxWidth: 450, mx: 'auto' }}>
                        Thank you! Your message has been submitted. I will Connect you soon
                    </Alert>
                )}

                <Box
                    component="form"
                    sx={{
                        maxWidth: 450,
                        margin: "0 auto",
                        borderRadius: 12,
                        p: { xs: 3, md: 5 },
                        display: "flex",
                        flexDirection: "column",
                        gap: 3,
                        mt: 5,
                        backdropFilter: "blur(12px)",
                        backgroundColor: "rgba(255,255,255,0.07)",
                        boxShadow: "0px 8px 30px rgba(0,0,0,0.5)",
                        position: "relative",
                        border: "3px solid yellow",
                    }}
                    onSubmit={handleSubmit}
                >
                    <TextField
                        label="Full Name"
                        name="name"
                        variant="outlined"
                        fullWidth
                        value={formData.name}
                        onChange={handleChange}
                        error={!!errors.name}
                        helperText={errors.name}
                        InputLabelProps={{ style: { color: 'lightgray' } }}
                        InputProps={{
                            style: { color: 'white', borderRadius: "12px" },
                        }}
                        sx={{
                            "& .MuiOutlinedInput-root": {
                                "& fieldset": { borderColor: "rgba(255,255,255,0.3)" },
                                "&:hover fieldset": { borderColor: "white" },
                                "&.Mui-focused fieldset": { borderColor: "#a29bfe", boxShadow: "0 0 8px #a29bfe" },
                            },
                        }}
                    />

                    <TextField
                        label="Email Address"
                        name="email"
                        type="email"
                        variant="outlined"
                        fullWidth
                        value={formData.email}
                        onChange={handleChange}
                        error={!!errors.email}
                        helperText={errors.email}
                        InputLabelProps={{ style: { color: 'lightgray' } }}
                        InputProps={{
                            style: { color: 'white', borderRadius: "12px" },
                        }}
                        sx={{
                            "& .MuiOutlinedInput-root": {
                                "& fieldset": { borderColor: "rgba(255,255,255,0.3)" },
                                "&:hover fieldset": { borderColor: "white" },
                                "&.Mui-focused fieldset": { borderColor: "#a29bfe", boxShadow: "0 0 8px #a29bfe" },
                            },
                        }}
                    />

                    <TextField
                        label="Message"
                        name="message"
                        multiline
                        rows={4}
                        variant="outlined"
                        fullWidth
                        value={formData.message}
                        onChange={handleChange}
                        error={!!errors.message}
                        helperText={errors.message}
                        InputLabelProps={{ style: { color: 'lightgray' } }}
                        InputProps={{
                            style: { color: 'white', borderRadius: "12px" },
                        }}
                        sx={{
                            "& .MuiOutlinedInput-root": {
                                "& fieldset": { borderColor: "rgba(255,255,255,0.3)" },
                                "&:hover fieldset": { borderColor: "white" },
                                "&.Mui-focused fieldset": { borderColor: "#a29bfe", boxShadow: "0 0 8px #a29bfe" },
                            },
                        }}
                    />

                    <Button
                        type="submit"
                        variant="contained"
                        sx={{
                            background: "linear-gradient(135deg, #ffffff, #dfe6e9)",
                            color: 'rgb(13, 1, 33)',
                            "&:hover": { background: "linear-gradient(135deg, #4a2a87, #6c5ce7)", color: "white" },
                            fontSize: "1rem",
                            textTransform: "none",
                            fontWeight: "bold",
                            borderRadius: "30px",
                            py: 1.5,
                            transition: "0.3s ease",
                        }}
                    >
                        Submit
                    </Button>
                </Box>
            </Box>
        </Grid>
    );
};

export default Contact;
